column1:
Senhores segue meus comentários.

A entrega do produto não foi satisfatória apresentando as seguintes características:

- embalagem aberta e rasurada;
- áreas raspadas
- algumas partes trincadas;
- sujo;
- o produto estava sem acomodação adequada, permitindo que o mesmo se movimentasse dentro da caixa;


Com isso, não foi possível realizar a montagem. Já entrei em contato com a Polishop para retirada do mesmo, pois não existe a possibilidade de envio através dos correios e informo também que sefaz necessário o envio de uma fita para fechar a caixa.

Desde já agradeço.

Laura C. Silva

A cor é fiel ao produto anunciado;
O cós do short é muito baixo;
A qualidade não foi o que eu esperava;

A Loja Lookstore me surpreendeu positivamente em todos os processos da compra; 
Site possui plataforma informativa excelente;
O atendimento via WhatsApp é rápido e incisivo;
Entrega antes do prazo, com rastreio em tempo real do produto; 
Produto de excelente qualidade, perfeito!

Indico, me fidelizei!

Dois pontos: 

1 ) A materia prima utilizada parece ser muito fragil...O que pode rasgar com facilidade e dar bolinhas;

2 ) Tenho várias camisas da Shoulder e me parece que os cortes são todos iguais...

ainda não chegou;
gostei pelo visual;
o formato me ajuda, devido mal formação óssea no pé.

Não tem botão liga/desliga conforme indica o manual de usuário.
Não altera a temperatura conforme indica o manual de usuário;

Fica ligada direto em stand bay siguinifica consumo de energia.
